import React from 'react'
import './navbar.css'


const Navbar = () =>{
    return (
        <>
            <div className="navbar">
                <div className="logo">
                    <a href="#">Logo</a>
                </div>
                <div className="menu_bar">
                    
                </div>
            </div>
        </>
    )
}
export default Navbar;
